// ============================================================================
// UTILITY FUNCTIONS
// ============================================================================

function rotateTileShape(shape, rotations) {
  // Rotate a tile shape 90 degrees clockwise, rotations times
  let result = shape;
  for (let i = 0; i < rotations % 4; i++) {
    result = result.map(([r, c]) => [c, -r]);
    // Normalize to start at 0,0
    const minR = Math.min(...result.map(([r]) => r));
    const minC = Math.min(...result.map(([, c]) => c));
    result = result.map(([r, c]) => [r - minR, c - minC]);
  }
  return result;
}

function canPlaceTile(board, row, col, tileShape) {
  // Check if tile can be placed at this position
  for (const [dr, dc] of tileShape) {
    const r = row + dr;
    const c = col + dc;
    
    // Out of bounds
    if (r < 0 || r >= 15 || c < 0 || c >= 10) return false;
    
    // Cell already covered
    if (board[r][c]?.covered) return false;
  }
  return true;
}

function canCrossWithBridge(tileType, board, row, col, tileShape) {
  // Check if a 3-tile can cross over another tile of the same type using bridge
  if (!tileType.includes('_3')) return false;
  
  const baseType = tileType.split('_')[0]; // 'Road', 'River', or 'Railroad'
  
  for (const [dr, dc] of tileShape) {
    const r = row + dr;
    const c = col + dc;
    
    if (r < 0 || r >= 15 || c < 0 || c >= 10) return false;
    
    const cell = board[r][c];
    if (cell?.covered) {
      // Can only cross if it's the same type
      if (!cell.coveredBy?.startsWith(baseType)) return false;
    }
  }
  return true;
}

// ============================================================================
// MAIN GAME COMPONENT
