export default function WackyWackyWest() {
  // Game state
  const [gameState, setGameState] = useState('lobby'); // lobby, playing, voting, gameover
  const [players, setPlayers] = useState([]);
  const [currentPlayer, setCurrentPlayer] = useState(0);
  const [board, setBoard] = useState(null);
  const [playerHands, setPlayerHands] = useState({});
  const [playerVoteCards, setPlayerVoteCards] = useState({});
  const [playerSecretBuildings, setPlayerSecretBuildings] = useState({});
  const [workers, setWorkers] = useState([0, 0, 0, 0]); // 4 workers, position 0-60
  const [tileDeck, setTileDeck] = useState([]);
  const [votingState, setVotingState] = useState(null);
  
  // UI state
  const [selectedTile, setSelectedTile] = useState(null);
  const [tileRotation, setTileRotation] = useState(0);
  const [hoveredCell, setHoveredCell] = useState(null);
  const [draggedTile, setDraggedTile] = useState(null);
  
  // Player name input
  const [playerName, setPlayerName] = useState('');
  const [gameCode, setGameCode] = useState('');

  // Initialize board
  useEffect(() => {
    if (!board) {
      const initialBoard = BOARD_LAYOUT.map(row => 
        row.map(cell => cell ? {...cell, covered: false} : null)
      );
      setBoard(initialBoard);
    }
  }, []);

  // Create tile deck
  const createTileDeck = () => {
    const deck = [];
    for (const [tileType, count] of Object.entries(TILE_INVENTORY)) {
      for (let i = 0; i < count; i++) {
        deck.push({ type: tileType, id: `${tileType}_${i}` });
      }
    }
    // Shuffle
    for (let i = deck.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [deck[i], deck[j]] = [deck[j], deck[i]];
    }
    return deck;
  };

  // Create voting deck for a player
  const createVotingDeck = () => {
    return [
      'Yes_1', 'Yes_2', 'Yes_3',
      'No_1', 'No_2', 'No_3',
      'Wildcard', 'Indifferent'
    ];
  };

  // Start game
  const startGame = () => {
    if (players.length < 2) {
      alert('Need at least 2 players!');
      return;
    }

    const deck = createTileDeck();
    const hands = {};
    const voteCards = {};
    const secretBuildings = {};

    // Deal tiles to players
    for (let i = 0; i < players.length; i++) {
      hands[players[i]] = [
        deck.pop(), deck.pop(), deck.pop(),
        deck.pop(), deck.pop()
      ];
      voteCards[players[i]] = createVotingDeck();
    }

    // Assign secret buildings
    const shuffledBuildings = [...BUILDINGS].sort(() => Math.random() - 0.5);
    for (let i = 0; i < players.length; i++) {
      secretBuildings[players[i]] = shuffledBuildings[i % BUILDINGS.length];
    }

    setTileDeck(deck);
    setPlayerHands(hands);
    setPlayerVoteCards(voteCards);
    setPlayerSecretBuildings(secretBuildings);
    setGameState('playing');
  };

  // Render lobby
  if (gameState === 'lobby') {
    return (
      <div style={{
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #8B4513 0%, #D2691E 100%)',
        padding: '20px',
        fontFamily: 'Arial, sans-serif'
      }}>
        <div style={{
          maxWidth: '600px',
          margin: '0 auto',
          background: 'white',
          borderRadius: '15px',
          padding: '30px',
          boxShadow: '0 10px 30px rgba(0,0,0,0.3)'
        }}>
          <h1 style={{
            textAlign: 'center',
            color: '#8B4513',
            fontSize: '36px',
            marginBottom: '10px',
            fontFamily: 'Georgia, serif'
          }}>
             Wacky Wacky West 
          </h1>
          <p style={{ textAlign: 'center', color: '#666', marginBottom: '30px' }}>
            2-4 Players  Build or Destroy!
          </p>

          <div style={{ marginBottom: '20px' }}>
            <input
              type="text"
              placeholder="Enter your name"
              value={playerName}
              onChange={(e) => setPlayerName(e.target.value)}
              style={{
                width: '100%',
                padding: '12px',
                fontSize: '16px',
                border: '2px solid #ddd',
                borderRadius: '8px',
                marginBottom: '10px'
              }}
            />
            <button
              onClick={() => {
                if (playerName.trim() && players.length < 4) {
                  setPlayers([...players, playerName.trim()]);
                  setPlayerName('');
                }
              }}
              style={{
                width: '100%',
                padding: '12px',
                fontSize: '16px',
                background: '#228B22',
                color: 'white',
                border: 'none',
                borderRadius: '8px',
                cursor: 'pointer',
                fontWeight: 'bold'
              }}
            >
              Join Game
            </button>
          </div>

          {players.length > 0 && (
            <div style={{
              background: '#f9f9f9',
              padding: '15px',
              borderRadius: '8px',
              marginBottom: '20px'
            }}>
              <h3 style={{ margin: '0 0 10px 0', color: '#333' }}>
                Players ({players.length}/4):
              </h3>
              {players.map((player, i) => (
                <div key={i} style={{
                  padding: '8px',
                  background: 'white',
                  marginBottom: '5px',
                  borderRadius: '5px',
                  display: 'flex',
                  justifyContent: 'space-between',
                  alignItems: 'center'
                }}>
                  <span>{player}</span>
                  <button
                    onClick={() => setPlayers(players.filter((_, idx) => idx !== i))}
                    style={{
                      background: '#dc3545',
                      color: 'white',
                      border: 'none',
                      padding: '5px 10px',
                      borderRadius: '5px',
                      cursor: 'pointer',
                      fontSize: '12px'
                    }}
                  >
                    Remove
                  </button>
                </div>
              ))}
            </div>
          )}

          {players.length >= 2 && (
            <button
              onClick={startGame}
              style={{
                width: '100%',
                padding: '15px',
                fontSize: '18px',
                background: '#FFD700',
                color: '#8B4513',
                border: 'none',
                borderRadius: '8px',
                cursor: 'pointer',
                fontWeight: 'bold',
                boxShadow: '0 4px 8px rgba(0,0,0,0.2)'
              }}
            >
               START GAME 
            </button>
          )}
        </div>
      </div>
    );
  }

// This continues from WackyWackyWest.jsx after the lobby section

  // Helper to get valid placements for selected tile
  const getValidPlacements = () => {
    if (!selectedTile || !board) return [];
    
    const valid = [];
    const shape = rotateTileShape(TILE_SHAPES[selectedTile.type], tileRotation);
    
    for (let row = 0; row < 15; row++) {
      for (let col = 0; col < 10; col++) {
        if (canPlaceTile(board, row, col, shape) || 
            canCrossWithBridge(selectedTile.type, board, row, col, shape)) {
          valid.push({ row, col });
        }
      }
    }
    
    return valid;
  };

  // Place a tile on the board
  const placeTile = (row, col) => {
    if (!selectedTile) return;
    
    const shape = rotateTileShape(TILE_SHAPES[selectedTile.type], tileRotation);
    const newBoard = board.map(r => r.map(c => c ? {...c} : null));
    let coveredOuthouse = null;
    
    // Mark cells as covered
    for (const [dr, dc] of shape) {
      const r = row + dr;
      const c = col + dc;
      
      if (newBoard[r][c]?.type === 'outhouse' && !newBoard[r][c].covered) {
        coveredOuthouse = { row: r, col: c };
      }
      
      newBoard[r][c] = {
        ...newBoard[r][c],
        covered: true,
        coveredBy: selectedTile.type
      };
    }
    
    // Remove tile from hand
    const playerName = players[currentPlayer];
    const newHand = playerHands[playerName].filter(t => t.id !== selectedTile.id);
    
    // Draw new tile if available
    if (tileDeck.length > 0) {
      newHand.push(tileDeck[tileDeck.length - 1]);
      setTileDeck(tileDeck.slice(0, -1));
    }
    
    setPlayerHands({ ...playerHands, [playerName]: newHand });
    setBoard(newBoard);
    setSelectedTile(null);
    setTileRotation(0);
    
    // Check if we need to vote
    if (coveredOuthouse) {
      setVotingState({
        initiator: playerName,
        outhousePosition: coveredOuthouse,
        votes: {},
        wildcardChoices: {}
      });
      setGameState('voting');
    } else {
      // Next player
      setCurrentPlayer((currentPlayer + 1) % players.length);
    }
  };

  // Handle voting
  const castVote = (voteCard, wildcardChoice = null) => {
    const playerName = players[currentPlayer];
    const newVotingState = { ...votingState };
    
    newVotingState.votes[playerName] = voteCard;
    if (wildcardChoice) {
      newVotingState.wildcardChoices[playerName] = wildcardChoice;
    }
    
    // Remove vote card from player's hand
    const newVoteCards = { ...playerVoteCards };
    newVoteCards[playerName] = newVoteCards[playerName].filter(c => c !== voteCard);
    setPlayerVoteCards(newVoteCards);
    
    setVotingState(newVotingState);
    
    // Check if all players have voted
    if (Object.keys(newVotingState.votes).length === players.length) {
      resolveVote(newVotingState);
    } else {
      // Next player votes
      setCurrentPlayer((currentPlayer + 1) % players.length);
    }
  };

  // Resolve the vote
  const resolveVote = (vState) => {
    let yesVotes = 0;
    let noVotes = 0;
    
    for (const [player, voteCard] of Object.entries(vState.votes)) {
      if (voteCard === 'Indifferent') continue;
      
      if (voteCard === 'Wildcard') {
        const choice = vState.wildcardChoices[player];
        if (choice === 'yes') yesVotes += 3;
        else if (choice === 'no') noVotes += 3;
      } else if (voteCard.startsWith('Yes')) {
        yesVotes += VOTE_STRENGTHS[voteCard];
      } else if (voteCard.startsWith('No')) {
        noVotes += VOTE_STRENGTHS[voteCard];
      }
    }
    
    const { row, col } = vState.outhousePosition;
    
    if (noVotes > yesVotes) {
      // Outhouse is saved! Uncover it
      const newBoard = board.map(r => r.map(c => c ? {...c} : null));
      newBoard[row][col].covered = false;
      delete newBoard[row][col].coveredBy;
      setBoard(newBoard);
    }
    
    // Return to playing
    setGameState('playing');
    setVotingState(null);
    setCurrentPlayer((currentPlayer + 1) % players.length);
  };

  // Calculate scores
  const calculateScores = () => {
    const scores = {};
    
    for (const player of players) {
      const secretBuilding = playerSecretBuildings[player];
      let score = 15; // Start at 15
      
      // Subtract value of each covered building of player's type
      for (const row of board) {
        for (const cell of row) {
          if (cell && cell.type === secretBuilding && cell.covered) {
            score -= cell.value;
          }
        }
      }
      
      scores[player] = Math.max(0, score);
    }
    
    return scores;
  };

  // Check if game is over
  useEffect(() => {
    if (gameState !== 'playing') return;
    
    // Game ends when all tiles are played or no valid moves
    const anyPlayerHasTiles = Object.values(playerHands).some(hand => hand.length > 0);
    
    if (!anyPlayerHasTiles && tileDeck.length === 0) {
      setGameState('gameover');
    }
  }, [playerHands, tileDeck, gameState]);

  // Render voting phase
  if (gameState === 'voting') {
    const playerName = players[currentPlayer];
    const playerVotes = playerVoteCards[playerName] || [];
    
    return (
      <div style={{
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #8B4513 0%, #D2691E 100%)',
        padding: '20px'
      }}>
        <div style={{
          maxWidth: '800px',
          margin: '0 auto',
          background: 'white',
          borderRadius: '15px',
          padding: '30px'
        }}>
          <h2 style={{ textAlign: 'center', color: '#8B4513' }}>
             Outhouse Under Threat! 
          </h2>
          <p style={{ textAlign: 'center', fontSize: '18px', marginBottom: '30px' }}>
            <strong>{votingState.initiator}</strong> is trying to cover an outhouse!
            <br />
            <strong>{playerName}</strong>, cast your vote to save or allow it!
          </p>

          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(auto-fit, minmax(120px, 1fr))',
            gap: '15px',
            marginBottom: '20px'
          }}>
            {playerVotes.map((card, idx) => (
              <div key={idx} style={{ textAlign: 'center' }}>
                <img
                  src={IMAGES.votes[card]}
                  alt={card}
                  onClick={() => {
                    if (card === 'Wildcard') {
                      const choice = prompt('Vote YES or NO?').toLowerCase();
                      if (choice === 'yes' || choice === 'no') {
                        castVote(card, choice);
                      }
                    } else {
                      castVote(card);
                    }
                  }}
                  style={{
                    width: '100%',
                    height: 'auto',
                    borderRadius: '8px',
                    cursor: 'pointer',
                    border: '3px solid transparent',
                    transition: 'all 0.2s'
                  }}
                  onMouseOver={(e) => e.target.style.border = '3px solid #FFD700'}
                  onMouseOut={(e) => e.target.style.border = '3px solid transparent'}
                />
                <p style={{ fontSize: '12px', marginTop: '5px' }}>
                  {card.replace('_', ' ')}
                </p>
              </div>
            ))}
          </div>

          <div style={{
            background: '#f0f0f0',
            padding: '15px',
            borderRadius: '8px'
          }}>
            <h4>Votes Cast:</h4>
            {Object.entries(votingState.votes).map(([player, vote]) => (
              <div key={player}>
                {player}: {vote}
                {votingState.wildcardChoices[player] && 
                  ` (${votingState.wildcardChoices[player].toUpperCase()})`}
              </div>
            ))}
          </div>
        </div>
      </div>
    );
  }

  // Render game over
  if (gameState === 'gameover') {
    const scores = calculateScores();
    const winner = Object.entries(scores).reduce((a, b) => a[1] > b[1] ? a : b);
    
    return (
      <div style={{
        minHeight: '100vh',
        background: 'linear-gradient(135deg, #8B4513 0%, #D2691E 100%)',
        padding: '20px'
      }}>
        <div style={{
          maxWidth: '600px',
          margin: '0 auto',
          background: 'white',
          borderRadius: '15px',
          padding: '30px',
          textAlign: 'center'
        }}>
          <h1 style={{ color: '#FFD700', fontSize: '48px' }}> GAME OVER! </h1>
          <h2 style={{ color: '#8B4513', marginBottom: '30px' }}>
            Winner: {winner[0]}!
          </h2>

          <div style={{ marginBottom: '30px' }}>
            <h3>Final Scores:</h3>
            {Object.entries(scores)
              .sort((a, b) => b[1] - a[1])
              .map(([player, score]) => (
                <div key={player} style={{
                  padding: '15px',
                  background: player === winner[0] ? '#FFD700' : '#f9f9f9',
                  marginBottom: '10px',
                  borderRadius: '8px',
                  fontSize: '20px',
                  fontWeight: 'bold'
                }}>
                  {player}: {score} points
                  <br />
                  <span style={{ fontSize: '14px', fontWeight: 'normal' }}>
                    (Protected: {playerSecretBuildings[player]})
                  </span>
                </div>
              ))}
          </div>

          <button
            onClick={() => window.location.reload()}
            style={{
              padding: '15px 30px',
              fontSize: '18px',
              background: '#228B22',
              color: 'white',
              border: 'none',
              borderRadius: '8px',
              cursor: 'pointer',
              fontWeight: 'bold'
            }}
          >
            Play Again
          </button>
        </div>
      </div>
    );
  }

  // MAIN GAME BOARD RENDER
  const validPlacements = selectedTile ? getValidPlacements() : [];
  const playerName = players[currentPlayer];
  const playerHand = playerHands[playerName] || [];

  return (
    <div style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #8B4513 0%, #D2691E 100%)',
      padding: '20px',
      fontFamily: 'Arial, sans-serif'
    }}>
      {/* Header */}
      <div style={{
        background: 'white',
        borderRadius: '10px',
        padding: '15px',
        marginBottom: '20px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.2)'
      }}>
        <h2 style={{ margin: '0 0 10px 0', color: '#8B4513' }}>
          Wacky Wacky West - Turn {currentPlayer + 1}
        </h2>
        <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <div>
            <strong>Current Player:</strong> {playerName}
            <br />
            <strong>Secret Building:</strong> 
            <span style={{ 
              background: '#FFD700', 
              padding: '2px 8px', 
              borderRadius: '5px',
              marginLeft: '5px'
            }}>
              {playerSecretBuildings[playerName]}
            </span>
          </div>
          <div>
            <strong>Tiles Left:</strong> {tileDeck.length}
          </div>
        </div>
      </div>

      {/* Game Board */}
      <div style={{
        background: 'white',
        borderRadius: '10px',
        padding: '20px',
        marginBottom: '20px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.2)',
        position: 'relative'
      }}>
        {/* Board background image */}
        <div style={{
          position: 'relative',
          width: '100%',
          maxWidth: '1000px',
          margin: '0 auto'
        }}>
          <img 
            src={IMAGES.board} 
            alt="Game Board"
            style={{
              width: '100%',
              height: 'auto',
              display: 'block',
              borderRadius: '10px'
            }}
          />
          
          {/* Overlay grid for interaction */}
          <div style={{
            position: 'absolute',
            top: 0,
            left: 0,
            width: '100%',
            height: '100%',
            display: 'grid',
            gridTemplateRows: 'repeat(15, 1fr)',
            gridTemplateColumns: 'repeat(10, 1fr)',
            gap: '0px'
          }}>
            {board && board.map((row, r) => row.map((cell, c) => {
              const isValid = validPlacements.some(p => p.row === r && p.col === c);
              const isHovered = hoveredCell?.row === r && hoveredCell?.col === c;
              
              return (
                <div
                  key={`${r}-${c}`}
                  style={{
                    border: '1px solid rgba(255,255,255,0.1)',
                    background: isValid ? 'rgba(0,255,0,0.3)' : 
                               isHovered ? 'rgba(255,255,0,0.2)' :
                               cell?.covered ? 'rgba(255,0,0,0.2)' : 
                               'transparent',
                    cursor: isValid ? 'pointer' : 'default',
                    transition: 'all 0.2s',
                    position: 'relative'
                  }}
                  onClick={() => isValid && placeTile(r, c)}
                  onMouseEnter={() => setHoveredCell({ row: r, col: c })}
                  onMouseLeave={() => setHoveredCell(null)}
                >
                  {cell?.covered && (
                    <div style={{
                      position: 'absolute',
                      top: 0,
                      left: 0,
                      width: '100%',
                      height: '100%',
                      background: 'rgba(0,0,0,0.4)',
                      display: 'flex',
                      alignItems: 'center',
                      justifyContent: 'center'
                    }}>
                      <span style={{ fontSize: '10px', color: 'white' }}></span>
                    </div>
                  )}
                </div>
              );
            }))}
          </div>
        </div>
      </div>

      {/* Player Hand */}
      <div style={{
        background: 'white',
        borderRadius: '10px',
        padding: '20px',
        boxShadow: '0 4px 8px rgba(0,0,0,0.2)'
      }}>
        <h3 style={{ margin: '0 0 15px 0', color: '#8B4513' }}>
          Your Tiles {selectedTile && '(Click tile again or press R to rotate)'}
        </h3>
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fill, minmax(150px, 1fr))',
          gap: '15px'
        }}>
          {playerHand.map((tile, idx) => (
            <div
              key={tile.id}
              onClick={() => {
                if (selectedTile?.id === tile.id) {
                  // Rotate if clicking same tile
                  setTileRotation((tileRotation + 1) % 4);
                } else {
                  setSelectedTile(tile);
                  setTileRotation(0);
                }
              }}
              style={{
                border: selectedTile?.id === tile.id ? '4px solid #FFD700' : '2px solid #ddd',
                borderRadius: '8px',
                padding: '10px',
                cursor: 'pointer',
                background: selectedTile?.id === tile.id ? '#FFFACD' : 'white',
                transition: 'all 0.2s',
                transform: selectedTile?.id === tile.id ? `rotate(${tileRotation * 90}deg) scale(1.1)` : 'none'
              }}
            >
              <img
                src={IMAGES.tiles[tile.type]}
                alt={tile.type}
                style={{
                  width: '100%',
                  height: 'auto',
                  display: 'block',
                  borderRadius: '5px'
                }}
              />
              <p style={{
                textAlign: 'center',
                margin: '5px 0 0 0',
                fontSize: '12px',
                fontWeight: 'bold'
              }}>
                {tile.type.replace('_', ' ')}
              </p>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
}

